<body>
    <canvas id='canvas' width='744' height='1052'></canvas>
    <script>

// #layer1

	ctx.save();

	ctx.quadraticCurveTo(98.350906, 310.600878, 98.350906, 310.600878);
	ctx.lineTo(562.444196, 310.600878);
	ctx.quadraticCurveTo(562.444196, 310.600878, 562.444196, 304.741267);

    </script>
